(967, 'Amuleto del Cautiverio', 'Blindaje de Hielo: Reduce el daño recibido de los ataques de hielo.'),
(968, 'Medallón del Relámpago', 'Poder de la Tormenta: Aumenta el daño en presencia de efectos climáticos.'),
(969, 'Gargantilla de la Furia', 'Llamas Ardientes: Añade daño de fuego a tus ataques.'),
(970, 'Collar del Maestro', 'Aumento de Duración: Aumenta la duración de los efectos beneficiosos aplicados por el jugador.'),
(971, 'Colgante de la Condena', 'Golpe Crítico: Aumenta las posibilidades de golpear críticamente.'),
(972, 'Talismán del Eclipse', 'Maldición Mortal: Aplica maldiciones a los enemigos que debilitan sus habilidades.'),
(973, 'Gargantilla de la Sabiduría', 'Teletransportación: Permite al jugador teletransportarse a corta distancia.'),
